// Get, parse, and return TLE structures
var tle={content:null,lines:null,tles:null,readFile:function(e){var t=new XMLHttpRequest,n=!1;t.open("GET",e,n);t.send();if(t.status!==200)return null;this.content=t.responseText;return this.content},readFileLines:function(e){this.readFile(e);this.lines=this.content.split("\n");return this.lines},parseFile:function(e){var t=this.readFileLines(e),n,r=[],i=[];for(linenum=0;linenum<t.length;linenum++)if(t[linenum].substring(0,2)==="1 ")r[1]=t[linenum];else if(t[linenum].substring(0,2)==="2 "){r[2]=t[linenum];i.push(r);r=[]}else r[0]=t[linenum];console.log("tle.js: File="+e+" TLEs="+i.length);this.tles=i;return i}};